def NameHand(score, ListKickers = False):
	HandCategory = GetHandCategory(score)
	if HandCategory not in (HIGHCARD, STRAIGHT):
		cards = HandContent[score]

	if HandCategory == HIGHCARD:
		cards = HandContent[score - 5863]
		return 'High card: %s%s' % (CardNames['singular'][cards[0]], "with %s, %s, %s and %s kickers" % (CardNames['singular'][cards[1]], CardNames['singular'][cards[2]], CardNames['singular'][cards[3]], CardNames['singular'][cards[4]]) if ListKickers else "")

	if HandCategory == PAIR:
		return 'Pair: %s%s' % (CardNames['plural'][cards[0]], "with %s, %s and %s kickers" % (CardNames['singular'][cards[2]], CardNames['singular'][cards[3]], CardNames['singular'][cards[4]]) if ListKickers else "")

	if HandCategory == TWOPAIR:
		return 'Two pair: %s and %s%s' % (CardNames['plural'][cards[0]], CardNames['plural'][cards[2]], "with a%s %s kicker" % ("n" if cards[4][0] in ("A", "8") else "", CardNames['singular'][cards[4]]) if ListKickers else "")

	if HandCategory == TRIPS:
		return 'Trips: %s%s' % (CardNames['plural'][cards[0]], "with %s and %s kickers" % (CardNames['singular'][cards[3]], CardNames['singular'][cards[4]]) if ListKickers else "")

	if HandCategory == STRAIGHT:
		cards = HandContent[score - 1599]
		return 'Straight: %s high' % (CardNames['singular'][cards[0]])

	if HandCategory == FLUSH:
		return 'Flush: %s high%s' % (CardNames['singular'][cards[0]], ' with a%s %s, a%s %s, a%s %s and a%s %s' % ("n" if cards[1][0] in ("A", "8") else "", CardNames['singular'][cards[1]], "n" if cards[2][0] in ("A", "8") else "", CardNames['singular'][cards[2]], "n" if cards[3][0] in ("A", "8") else "", CardNames['singular'][cards[3]], "n" if cards[4][0] in ("A", "8") else "", CardNames['singular'][cards[4]]) if ListKickers else "")

	if HandCategory == FULLHOUSE:
		return 'Full house: %s over %s' % (CardNames['plural'][cards[0]], CardNames['plural'][cards[3]])

	if HandCategory == QUADS:
		return 'Quads: %s%s' % (CardNames['plural'][cards[0]], ' with a%s %s' % ("n" if cards[4][0] in ("A", "8") else "", CardNames['singular'][cards[4]]) if ListKickers else '')

	if HandCategory == STRAIGHTFLUSH:
		if cards[0] == 'A':
			return 'Royal flush'
		return 'Straight flush: %s high' % (CardNames['singular'][cards[0]],)
